import React from "react";
import { Image, Grid, Dropdown, Menu } from "semantic-ui-react";
export default function brands() {


    
  return (
    <div>
      <Image src="images/markalar.PNG" size="massive" centered />
      <br />

      <Grid>
        <Grid.Column width={3}>
          <Menu compact>
            <Dropdown text="Dropdown" options={options} simple item />
          </Menu>
        </Grid.Column>
        <Grid.Column width={13}>
          <Image src="images/markalar.PNG" size="massive" centered />
        </Grid.Column>
      </Grid>
    </div>
  );
}
